import React from 'react';
import { ExternalLink, Github } from 'lucide-react';

function Projects() {
  const projects = [
    { 
      id: 1, 
      title: 'E-commerce Platform', 
      description: 'A full-stack e-commerce platform built with React and Node.js. Features include user authentication, product catalog, shopping cart, and payment integration.',
      image: '/placeholder.svg?height=200&width=300',
      link: '#',
      github: '#'
    },
    { 
      id: 2, 
      title: 'Task Management App', 
      description: 'A React-based task management application with drag-and-drop functionality. Includes features like task categorization, due dates, and team collaboration.',
      image: '/placeholder.svg?height=200&width=300',
      link: '#',
      github: '#'
    },
    { 
      id: 3, 
      title: 'Weather Dashboard', 
      description: 'A weather dashboard that fetches and displays real-time weather data. Built with React and integrates with a third-party weather API.',
      image: '/placeholder.svg?height=200&width=300',
      link: '#',
      github: '#'
    },
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-purple-100 to-indigo-100 py-16">
      <div className="container mx-auto px-4">
        <h1 className="text-4xl font-bold text-purple-800 mb-8 text-center">My Projects</h1>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {projects.map(project => (
            <div key={project.id} className="bg-white rounded-lg shadow-md overflow-hidden">
              <img src={project.image} alt={project.title} className="w-full h-48 object-cover" />
              <div className="p-6">
                <h2 className="text-2xl font-bold text-purple-600 mb-2">{project.title}</h2>
                <p className="text-gray-700 mb-4">{project.description}</p>
                <div className="flex justify-between">
                  <a href={project.link} className="text-purple-600 hover:text-purple-800 flex items-center">
                    <ExternalLink size={20} className="mr-1" /> View Project
                  </a>
                  <a href={project.github} className="text-purple-600 hover:text-purple-800 flex items-center">
                    <Github size={20} className="mr-1" /> GitHub
                  </a>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Projects;
